
import { Base64 } from 'js-base64';

const bundle = '';
const bundle_0 = '';
const bundle_1 = '';

export default (num) => {
  if(!num) {
    return Base64.decode(bundle)
  } else if(num === 0) {
    return Base64.decode(bundle_0)
  } else if(num === 1) {
    return Base64.decode(bundle_1)
  }
  throw 'unknown bundle number'
};
